/**
 * @param id {String}
 * @param name {String}
 * @param defaultAvatarOrdinal {Number} 0-7
 * @param avatar {ByteArray}
 * @param channelsSubscribedTo {StringArray}
 */
export function User(id, name, defaultAvatarOrdinal, avatar, channelsSubscribedTo) {
	return {
		_id: id, name, defaultAvatarOrdinal, avatar, channelsSubscribedTo
	};
}
